import React from "react";
import memoryService from "./services/memories";
import { useState, useEffect } from "react";

const App = () => {
  const [memories, setMemories] = useState([]);

  useEffect(() => {
    console.log("effect");
    memoryService.getAll().then((initialMemories) => {
      console.log("promise fulfilled");
      setMemories(initialMemories);
    });
  }, []);
  console.log("render", memories.length, "notes");

  return (
    <div>
      {memories.map((m) => (
        <p key={memories.id}>{memories.content}</p>
      ))}
    </div>
  );
};

export default App;
